import * as React from "react";
import { Logo } from "./Logo";
import { NavItem } from "./NavItem";

const navItems = [
  { label: "Home", isHighlighted: false },
  { label: "Languages", isHighlighted: false },
  { label: "Subjects", isHighlighted: false },
  { label: "About Us", isHighlighted: false },
  { label: "Contact Us", isHighlighted: true }
];

export const Navbar: React.FC = () => {
  const [isScrolled, setIsScrolled] = React.useState(false);

  React.useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <nav className={`fixed top-0 left-0 right-0 z-50 px-4 py-2 transition-all duration-300 ${isScrolled ? 'py-1' : 'py-3'}`}>
      <div 
        className="max-w-7xl mx-auto bg-neutral-900 rounded-[30px] shadow-lg transition-all duration-300 hover:shadow-xl"
        role="navigation" 
        aria-label="Main navigation"
      >
        <div className="flex flex-wrap items-center justify-between lg:justify-start lg:gap-12">
          <Logo
            imageUrl="https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/f97096619879b9bb974b1d3321e3e5a9268b9b643dd7987cd5ce3bfec8fe55bf?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&"
            title="CURIOUSOZZY"
          />

          {/* Mobile Menu Button */}
          <button className="lg:hidden px-4 py-2 text-gray-200 hover:text-primary-coral">
            <svg className="w-6 h-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
            </svg>
          </button>

          {/* Navigation Items */}
          <div className="hidden lg:flex flex-1 items-center justify-end gap-6 pr-8">
            {navItems.map((item, index) => (
              <NavItem
                key={index}
                label={item.label}
                isHighlighted={item.isHighlighted}
              />
            ))}
          </div>
        </div>

        {/* Mobile Menu (hidden by default) */}
        <div className="hidden px-4 py-2 lg:hidden">
          <div className="flex flex-col gap-2">
            {navItems.map((item, index) => (
              <NavItem
                key={index}
                label={item.label}
                isHighlighted={item.isHighlighted}
              />
            ))}
          </div>
        </div>
      </div>
    </nav>
  );
};
